import React, { Component } from "react";
import ValidationHoc from "../../../../../hoc/validationHoc"

import { connect } from "react-redux";
// TODO @SONIA

class MobileNumber extends React.Component {
    constructor() {
        super();

    }
    componentDidMount() {
        this.props.setInitialData({ mobileNumber: this.props.userData })
    }
    render() {
        const { mobileNumber } = this.props.values;

        return (
            <div className="">{mobileNumber}</div>
        );
    }
}
export default ValidationHoc(MobileNumber);
